import "./App.css";
import React from "react";
import Home from "./Home";
import { Route, Switch } from "react-router";

const App = () => {
  return (
    <>
      {/* we use switch because multiple pages me se koi ekhi page dikhaye jo sabse pahile match hojata hai i.e url jiska match hojata hai*/}
      <Switch>
        <Route exact path="/" component={Home} />
      </Switch>
    </>
  );
};

export default App;
